export function isSet(obj: any): boolean;
export class Set {
    static fromArray(arr: any): any;
    constructor(set: any, ...args: any[]);
    elements: any[];
    add(x: any): void;
    contains(x: any): boolean;
    each(f: any): Set;
    clone(): Set;
    union(set: any): Set;
    difference(set: any): Set;
    remove(element: any): boolean;
    intersection(set: any): Set;
    intersects(set: any): boolean;
    is_subset(set: any): boolean;
    toString(): string;
}
